import React, { Component } from 'react';
import axios from 'axios';
import styled from 'styled-components';

export default class Profile extends Component {

  state = {
    skills : [],
  }

  componentDidMount(){
    axios.get('Data/Data.json').then(res =>  {
      this.setState({
        skills : res.data.skills ,
      })
    })
  }

  render() {
  
    const {skills} = this.state;
    const skillsSec = skills.map((skill)=> {
      return(
        <div >
            <div className='flex-full'>
              <h3> {skill.skill} </h3>
                <span> {skill.degree}% </span>
              </div>
              <hr />
        </div>
      )
    })

    return (
      <section className='flex-full main-padd'>
        <ProfileInfo>
          <h2> My Profile</h2>
          <InfoContainer>
            <div className='flex-full'>
              <h3> Name </h3>
              <span> Rabee Khalifa</span>
            </div>
            <div className='flex-full'>
              <h3> Birthday </h3>
              <span> 1997/29/11</span>
            </div>
            <div className='flex-full'>
              <h3> Address </h3>
              <span> Khartoum</span>
            </div>
            <div className='flex-full'>
              <h3> Phone </h3>
              <span> +249113583477 </span>
            </div>
            <div className='flex-full'>
              <h3> Email </h3>
              <span> rabie201097_1_11@hotmail.com</span>
            </div>
          </InfoContainer>
        </ProfileInfo>
        <Skills>
          <h2> Some Skills</h2>
          <SkillsContainer>
            <p> lorem nmj uio ytr ewq frty hjuu ygbb vfrt werq gtyu cvbbjh mjkl iop ikn hju yghjk jhyui qwdfdg</p>
            
            <div>
              <div className='flex-full'>
                <h3> CSS </h3>
                <span> 90% </span>
              </div>
              <hr />
            </div>
            <div>
              <div className='flex-full'>
                <h3> JavaScript </h3>
                <span> 90% </span>
              </div>
              <hr />
            </div>
          </SkillsContainer>
        </Skills>
      </section>
    )
  }
}

const ProfileInfo  = styled.div`
  h2{
    margin-bottom: 60px;
  }
`
const InfoContainer  = styled.div`
  div{
    margin-bottom: 10px;
    
    h3{
      width: 20%;
    }

    span{
      font-size: 0.8rem;
      width: 70%;
    }
  }

  .flex-full{
    justify-content: flex-start;
    gap: 50px;
    
  }
`
const Skills  = styled.div`

`
const SkillsContainer  = styled.div`
  p{
    margin: 30px 0px;
    width: 70%;
  }

  div{
    margin-top: 20px;

    hr{
      margin-top: 5px;
      border-color: orange;
    }
  }
`
